import { Link } from "react-router-dom";

const RootText = () => {
  return (
    <div>
      <h1>
        Build Personal Learning <br /> Network, <br />
        With Anyone, <br />
        Anywhere.
      </h1>
    </div>
  );
};

export default RootText;
